description:
Kendra Lust runs a high end massage parlor that caters to more than just a good sports rub down. Happy endings abound for a few select customers. But when her top employee quits, she scrambles to find a young, handsome masseur to cater to her wealthy female clients. Starring Kendra Lust, Riley Reid, Natalia Star, with James Deen, Marcus London and Evan stone.

